to system and server maintenance and events beyond your control. Product registration required."),s.createElement("p",{className:"default disclaimer__para"},"Customer support hours vary by product. QuickBooks Self Employed users have access to 24/7 live chat and email support. QuickBooks Online users can access phone support 6AM to 6PM Monday-Friday and 6AM-3PM Saturday PT."),s.createElement("p",{id:"disText",className:"default disclaimer__para"},"TSheets terms and conditions subject to change anytime. Please see ",s.createElement("a",{href:"https://www.tsheets.com/terms-of-service/"},"TSheets Terms of Service")," for more information."),s.createElement("p",{className:"default disclaimer__para"},"QuickBooks supported browsers: Chrome, Firefox, Edge, Internet Explorer 10, Safari 6.1."),s.createElement("p",{className:"default disclaimer__para"},"Terms, conditions, pricing, special features, and service and support options subject to change without notice."),s.createElement("ol",{className:"enterprise"},s.createElement("li",null,"Minimum technical requirements for QuickBooks Desktop Enterprise can be found in the Technical tab on this page."),s.createElement("li",null,"QuickBooks Desktop Enterprise subscription is good for 12 months from purchase date or subscription renewal date. . As part of the subscription, you have the option to add Intuit Data Protect for free as an active subscriber to QuickBooks Desktop Enterprise. Service begins as of the date activated and continues through to the expiration date of your QuickBooks Desktop Enterprise subscription. Subscription pricing, packages, features, functionality, service and support options are subject to change without notice. See terms and conditions at qbes.com/terms. Your purchase of QuickBooks Desktop Enterprise is a subscription. After year one, your credit card account will be automatically charged the then-current price of the QuickBooks Desktop Enterprise subscription every year unless and until you cancel. Cancel at any time by calling 800-300-8179, prior to your renewal date. If you cancel outside of the 60 days satisfaction period you will have access to Enterprise for the remainder of the year in which you paid an annual subscription. The following year you will no longer have access to the product or any of its connected services. We will authorize your card to ensure prompt order processing, resulting in a temporary hold on your account."),s.createElement("li",null,"If you choose to purchase QuickBooks Desktop Enterprise using the Monthly Payment Plan, you elect to pay your annual subscription in equal payments over the course of 12 months. Purchasing an annual subscription for QuickBooks Desktop Enterprise commits you to a 12 month term. You must pay for all 12 months of the subscription in full based on the then current rate of QuickBooks Desktop Enterprise. If you choose to cancel inside the first 60 days, you can opt to receive a refund per the 60 day money back guarantee (see https://enterprisesuite.intuit.com/legal/terms.jsp for details). However, if you choose to cancel after the first 60 days and prior to the end of month 12 you will be subject to a termination fee equal to the amount of monthly payments left on your annual subscription. For purpose of clarity, if you pay for 6 months and have 6 months remaining on your annual subscription, which starts at date of enrollment, you will be charged a termination fee equal to the then current monthly fee of QuickBooks Desktop Enterprise multiplied by 6 months (remaining months left on annual subscription)."),s.createElement("li",null,"Membership in Priority Circle and its benefits are available only to customers who have an active, paid subscription to one of the following products: QuickBooks Desktop Enterprise, QuickBooks Full Service Payroll, Intuit Full Service Payroll, QuickBooks Online Payroll, Desktop Assisted Payroll, and QuickBooks Payments. QuickBooks Desktop Enterprise customers must meet the following requirements for membership: QuickBooks Desktop Enterprise customers on the Full Service Plan must be on an active, paid subscription that is renewed on or after May 1, 2017. QuickBooks Desktop Enterprise customers on a Subscription Plan must be on an active, paid subscription that is renewed on or after September 18th, 2017. QuickBooks Payments customers must also meet the minimum charge volume thresholds: Current QuickBooks Payments customers with charge volume greater than $50,000 over the last 12 months become members of Priority Circle. New payments customers on a monthly subscription plan with charge volume greater than $4,000 over the first 30 days become members of Priority Circle. When customers no longer have an active, paid subscription, they will not be eligible to receive benefits. Payments customers who are on a monthly plan and meet the initial charge volume threshold will have Priority Circle access for 12 months as long as they have an active monthly subscription. Customers who cancel inadvertently (e.g., due to expired credit card) will receive a 15-day grace period and notification to re-activate their subscription to maintain Priority Circle membership and benefits."),s.createElement("li",null,"U.S.-based support for QuickBooks Desktop Enterprise is available weekdays from 4:00 am - 7:00 p.m. Pacific time. If support is needed outside these hours, the QuickBooks Core Support team is available 24/7. Support hours exclude occasional downtime due to system and server maintenance, company events, observed U.S. holidays and events beyond our control. Intuit reserves the right to limit each telephone contact to one hour and to one incident."),s.createElement("li",null,"Online Backup Service requires Internet access and an active QuickBooks Desktop Enterprise subscription. Entire PC is limited to 100GB total storage, which includes all 45 days which you have stored. In some cases data damage may be too extensive and the data file may be non-recoverab