$(document).ready(function () {
  // Expand functionality for Modal disclosure
$("body").on("click", ".modal-disclaimer a", function(){
  $(this).parents(".ReactModal__Content").toggleClass("active");
});
  // set initial position based on sticky support outmost container, add a 40 px offset to show icons in blue box only
  //var $headerRightColumn = $('.header-right-col');
  // move to the right based on new position
  //$headerRightColumn.css({"right": "-138px"});

  var isMobile = {
    Android: function () {
      return navigator.userAgent.match(/Android/i);
    },
    BlackBerry: function () {
      return navigator.userAgent.match(/BlackBerry/i);
    },
    iOS: function () {
      return navigator.userAgent.match(/iPhone|iPad|iPod/i);
    },
    Opera: function () {
      return navigator.userAgent.match(/Opera Mini/i);
    },
    Windows: function () {
      return navigator.userAgent.match(/IEMobile/i);
    },
    any: function () {
      return (isMobile.Android() || isMobile.BlackBerry() || isMobile.iOS() || isMobile.Opera() || isMobile.Windows());
    }
  };
  
  // triggered by on hover, slides button out or back in
  var set_slide_position = function () {
    // get DOM object
    var that = arguments[0];

    // get the initial right position
    var initial_position = $(that).css("right");

    // get container classname
    var container = arguments[1];
    var container2 = arguments[2];

    // get content container only since blue icon width is fixed at 40px
    var content_container = $(that).find(container);
    var content_container2 = $(that).find(container2);

    // get content container width
    var content_width = $(content_container).width();
    var content_width2 = $(content_container2).width();

    // if more than one container in <li> (container2 = true), choose maxwidth container
    if (container2) {
      content_width = (content_width2 > content_width) ? content_width2 : content_width;
    }

    // set new position to animate to with offset that considers CSS 8px padding
    var content_position = content_width + 16;

    // set both content containers to same width
    $(content_container).width(content_width);
    $(content_container2).width(content_width);

    // animate appropriately
    if (initial_position == "auto" || initial_position == "0px")
      $(that).animate({"right": content_position}, 500);
    else
      $(that).animate({"right": "0px"}, 500);
  };

  if (isMobile.any()) {
    $(".chat-icon-section").on("touchstart", function (e) {
      set_slide_position(this, ".chat-button-container");
    });
  }
  else {
    $(".chat-icon-section").hover(function () {
      set_slide_position(this, ".chat-button-container");
    });
  }
});

/* Code for UTM Tracking */
window.utm_tracking = function() {
  var ssTestId = wa.ssTestId || "";
  var mdsExpVal = window.getCookie("mds_3rdparty_experience_store") || "";
  if(ssTestId.length > 0) {
    ssTestId = ssTestId.replace(/,/g,"_");
    $("a[data-wa-link='se--pc-bnbtn-tosui-qbse'],a[data-wa-link='se--pc-bnbtn-tosui-qbset'],a[data-wa-link='se--cta-btn-to-trial-sui-qbse-try-it-free-bottom']").each(function(index) {
      var hrefVal = $(this).attr("href") || "";
      if(hrefVal.length > 0 && (hrefVal.charAt(0) == "/" || hrefVal.indexOf("http") > -1)) {
        $(this).attr('href', function() {
          //replace UTM value
          return this.href.replace(/(utm_medium=).*?(&)/,'$1' + "OA_" + ssTestId + '$2');
        });
        $(this).attr('href', function() {
          //append evar71 to the end of the URL
          paramSep = "&";
          if(!hrefVal.match(/\?/) ) {
            paramSep = "?";
          }
          var utmContent = window.getParameterByName("utm_content",hrefVal);
          if(mdsExpVal.length > 0 && utmContent !== null && utmContent.length > 0) {
            return this.href.replace(/(utm_content=).*?(&)/,'$1' + utmContent+ "_" + mdsExpVal + '$2');
          }
          else {
            return this.href + paramSep +'evar71='+ssTestId;
          }
        });
      }
    });
  }
}
window.getCookie = function(name) {
  var match = document.cookie.match(new RegExp(name + '=([^;]+)'));
  if (match) return match[1];
}
window.getParameterByName = function(name, url) {
  if (!url) url = window.location.href;
  name = name.replace(/[[]]/g, "$&");
  var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
      results = regex.exec(url);
  if (!results) return null;
  if (!results[2]) return '';
  return decodeURIComponent(results[2]);
}
</script>











        <script type="text/javascript">
/* sanitize inputs to regexp by escaping special chars */
function escapeRegExp(string){
  return string.replace(/([.*+?^=!:${}()|\[\]\/\\])/g, "\\$1");
}

/* extract a query parameter value from a URI */
function getUriParamVal(uri,key) {
  key = escapeRegExp(key);
  var pattern = "[\\?&]" + key + "=([^&#]*)";
  var regex = new RegExp(pattern, "i");
  var results = null;
  if (typeof(uri) != "undefined") { 
    results = regex.exec(uri);
    if (results != null) {
      results = results[1].replace(/\+/g, " ");
    }
  }
  return results;
}

/* replace the value of a query parameter (does not check/change URI encoding) */
function replaceUriParamVal(uri,key,newVal) {
  var results = uri;
  var oldVal = getUriParamVal(uri, key);
  if ((typeof(oldVal) === "string") && (typeof(newVal) === "string")) {
    var pattern = escapeRegExp(key) + "=" + escapeRegExp(oldVal);
    var regex = new RegExp(pattern, "gi");
    results = results.replace(regex, key + "=" + newVal);
  }
  return results;
}

function passthruParams(sourceURI, passthruParamKeys, passthruElementSelector, passthruPlaceholder) {
  /* define the params to pass through */
  var sourceHasPassthruParams = false;
  /* extract the passthru param values from the page URI */
  var passthruParamVals = new Array();
  /** NOTE: passthruParamKeys[i] matches passthruParamVals[i] **/
  /* iterate through the passthruParamKeys, searching the page URI for these keys */
  for (var i=0; i<passthruParamKeys.length; i++) {
    passthruParamVals[i] = getUriParamVal(sourceURI, passthruParamKeys[i]);
    if (passthruParamVals[i] != null) {sourceHasPassthruParams = true;}
  }
  /* next iterate through each link on the page */
  if (sourceHasPassthruParams) {
    /* get all links on page, and iterate through them using .each() */
    $(passthruElementSelector).each(function (index) {
      var linkHref = $(this).attr('href');
      if ((typeof linkHref == 'string') && (linkHref != "")) {
        var linkParamVal = "";
        var pattern = "";
        var regex;
        for (var i=0; i<passthruParamKeys.length; i++) {
          /* Replacement for old placeholder pattern: if this link contains the passthruParamKey, then modify it */
          linkParamVal = getUriParamVal(linkHref,passthruParamKeys[i]);
          if (linkParamVal != null) {
            if (linkParamVal.indexOf(passthruPlaceholder) != -1) {
              linkHref = replaceUriParamVal(linkHref,passthruParamKeys[i],passthruParamVals[i]);
              $(this).attr('href',linkHref);
            }
          }
          /* Replacement for new placeholder pattern: if this link contains "key_passthruPlaceholder" then modify it */
          if (linkHref.indexOf(passthruParamKeys[i] + "_" + passthruPlaceholder != -1)) {
            /* find the passthruParamKeys[i] + "_" passthruPlaceholder  */
            pattern = "(\\w*=)\\w*" + passthruParamKeys[i] + "_" + passthruPlaceholder;
            regex = new RegExp(pattern, "i");
            linkHref = linkHref.replace(regex, '$1'+ passthruParamVals[i]);
            $(this).attr('href',linkHref);
          }
        }
      }
    });
  }
}
window.attributionTracking = function() {
  <!-- Configure standard OA URI passthru parameters -->
  /* run the passthru parameters function on all links */
  var passthruParamKeys = ['cid','sc','keyword','ef_id'];
  var passthruElementSelector = "body a[href]";
  var passthruPlaceholder = "cmsplaceholder";

  /* search all links on the page - if they contain CID or SC replace with the window's CID/SC value */
  passthruParams(window.location.search, passthruParamKeys, passthruElementSelector, passthruPlaceholder);
}
</script>

